      then (x := (Link { parent = y }); root_y.value <- new_value; y)
      else
        (y := (Link { parent = x });
         root_x.value <- new_value;
         if rank_x = rank_y then root_x.rank <- (root_x.rank + 1);
         x)
with
| { contents } -> _)

